#===========================================================================
# Actually make the objects work
#===========================================================================
 
# Simple Exit function
Function AppExit(){
    $Form.Close()
}
 
# Load the XenApp SnapIns
Function LoadXenAppSnapins(){
    if ( (Get-PSSnapin -Name Citrix* -ErrorAction SilentlyContinue) -eq $null )
    {
        Add-PsSnapin citrix*
    }
}

# Get the list of Delivery Group and populate the ComboBox
Function Populate_DG(){
    LoadXenAppSnapins
    $dg = Get-BrokerDesktopGroup
    $dg | ForEach-object {$WPFDGComboBox.AddChild($_)}
}

# OpenFileDialog to browse for the .ico file
Function BrowseIcon(){

    $OpenFileDialog = New-Object System.Windows.Forms.OpenFileDialog
    $OpenFileDialog.initialDirectory = "C:\"
    $OpenFileDialog.filter = "ICO (*.ico)|*.ico"
    $OpenFileDialog.ShowDialog() | Out-Null
    $WPFIconPreview.source = $OpenFileDialog.filename
}
 
# Function to publish content with or without an icon
Function PublishContent {
Param(
    [Parameter(Mandatory=$true)][String]$Name,
    [Parameter(Mandatory=$true)][String]$Content,
    [Parameter(Mandatory=$true)][String]$DesktopGroup,
    [Parameter(Mandatory=$false)][String]$iconpath
    )

    # Create the Citrix Published Content
    New-BrokerApplication -ApplicationType PublishedContent -CommandLineExecutable $Content -Name $Name -DesktopGroup $DesktopGroup
    if($iconpath){
        # Encode the .ico file in Base64
        $b64ico = [convert]::ToBase64String((get-content -Encoding byte -Path $iconpath ))

        # Adds the encoded icon in Citrix Database
        $ctxico = New-BrokerIcon -EncodedIconData $b64ico

        # Set the icon to the newly created application
        Set-BrokerApplication -Name $Name -IconUid $ctxico.Uid
    }
}
 
### Main Function ###

# Define Exit button
$WPFExitButton.Add_Click({AppExit})

#Define Image in application
$WPFimage.Source=[convert]::FromBase64String($b64_toolicon)

# Populate DG combo box
Populate_DG

# Display the default icon
$WPFIconPreview.source = [convert]::FromBase64String($b64_defaulticon)

# Define Browse button
$WPFBrowseButton.Add_Click({BrowseIcon})

# Define the Publish Button function
$WPFPublishButton.Add_Click({
    $PCName = $WPFPublishedContentName.text
    $PCLink = $WPFLink.text
    [string]$iconpath = $WPFIconPreview.source
    $iconpath = $iconpath.substring(8)
    write-host $iconpath
    $result = $true
    if(($PCName -eq "") -OR ($WPFDGComboBox.selectedItem -eq $null) -OR ($PCLink -eq "")){
        $result = $false
    }
    write-host "Name is      : " $PCName
    write-host "Link is      : " $PCLink
    write-host "DG is        : " ($WPFDGComboBox.selectedItem).Name
    write-host "Icon file is : " $WPFIconPreview.source
    if($result -eq $false){
        [System.Windows.Forms.MessageBox]::Show("Invalid parameters", "Error")
    }else{
        if($iconpath -ne $null){
            PublishContent -Name $PCName -Content $PCLink -DesktopGroup ($WPFDGComboBox.selectedItem).Name -iconpath $iconpath
        }else{
            PublishContent -Name $PCName -Content $PCLink -DesktopGroup ($WPFDGComboBox.selectedItem).Name
        }
        $outputMessage = "Content Published. `nPlease finalize the publication in Citrix Studio."
        [System.Windows.Forms.MessageBox]::Show($outputMessage, "Success")
    }
})

